create database log_data;

Drop table traffic_data;

create table traffic_data(
locale char(10), 
page_type char(1000), 
value int, 
pageCount int);



-- What are the five Wikipedia pages that were visited most often? --
select page_type from traffic_data where pageCount = (select max(pageCount) from traffic_data);
